import React from "react";

const Logo = () => (
  <div className="bot-fancy-font flex flex-col">
    <div className="text-white text-50 font-light tracking-tight">NEEK</div>
    <div className="flex">
      <div className="border-t-10 border-white" />
      <div className="text-10px">Software Engineer</div>
    </div>
  </div>
);

export default Logo;
